goog.provide("goog.date.relativeWithPlurals");goog.require("goog.date.relative");goog.require("goog.date.relative.Unit");goog.require("goog.i18n.MessageFormat");goog.date.relativeWithPlurals.formatTimeDelta_=function(delta,future,unit){if(!future&&unit==goog.date.relative.Unit.MINUTES){var MSG_MINUTES_AGO_ICU=goog.getMsg("{NUM, plural, "+"=0 {# minutes ago}"+"=1 {# minute ago}"+"other {# minutes ago}}");return new goog.i18n.MessageFormat(MSG_MINUTES_AGO_ICU).format({NUM:delta})}else if(future&&unit==goog.date.relative.Unit.MINUTES){var MSG_IN_MINUTES_ICU=goog.getMsg("{NUM, plural, "+"=0 {in # minutes}"+"=1 {in # minute}"+"other {in # minutes}}");return new goog.i18n.MessageFormat(MSG_IN_MINUTES_ICU).format({NUM:delta})}else if(!future&&unit==goog.date.relative.Unit.HOURS){var MSG_HOURS_AGO_ICU=goog.getMsg("{NUM, plural, "+"=0 {# hours ago}"+"=1 {# hour ago}"+"other {# hours ago}}");return new goog.i18n.MessageFormat(MSG_HOURS_AGO_ICU).format({NUM:delta})}else if(future&&unit==goog.date.relative.Unit.HOURS){var MSG_IN_HOURS_ICU=goog.getMsg("{NUM, plural, "+"=0 {in # hours}"+"=1 {in # hour}"+"other {in # hours}}");return new goog.i18n.MessageFormat(MSG_IN_HOURS_ICU).format({NUM:delta})}else if(!future&&unit==goog.date.relative.Unit.DAYS){var MSG_DAYS_AGO_ICU=goog.getMsg("{NUM, plural, "+"=0 {# days ago}"+"=1 {# day ago}"+"other {# days ago}}");return new goog.i18n.MessageFormat(MSG_DAYS_AGO_ICU).format({NUM:delta})}else if(future&&unit==goog.date.relative.Unit.DAYS){var MSG_IN_DAYS_ICU=goog.getMsg("{NUM, plural, "+"=0 {in # days}"+"=1 {in # day}"+"other {in # days}}");return new goog.i18n.MessageFormat(MSG_IN_DAYS_ICU).format({NUM:delta})}else{return""}};goog.date.relative.setTimeDeltaFormatter(goog.date.relativeWithPlurals.formatTimeDelta_);